import React from 'react';

const Profile = ({ username, favoriteMovies }) => {
    return (
        <div>
            <h1>{username}'s Profile</h1>
            <h2>Favorite Movies</h2>
            <ul>
                {favoriteMovies.map((movie, index) => (
                    <li key={index}>{movie}</li>
                ))}
            </ul>
        </div>
    );
};

export default Profile;
